window.bookSummaryJSON = "<p>Sherlock Holmes is an unparalleled genius. Warlock Holmes is an idiot. </p> <p>A font of arcane power, certainly. But he’s brilliantly dim. Frankly, he couldn’t deduce his way out of a paper bag. The only thing he has really got going for him are the might of a thousand demons and his stalwart companion. </p> <p>Thankfully, Dr. Watson is always there to aid him through the treacherous shoals of Victorian propriety...and save him from a gruesome death every now and again.</p> <p>Performed by Scott McCormick, Eric Messner, Patrick Bussink, David Jourdan, Matthew Keenan, Yasmin Tuazon, Jonathan Feuer, Bradley Smith, David Coyne, Steven Carpenter, Chris Davenport, Dani Stoller, Richard Rohan, Matthew Schleigh, Michael Glenn, Peter Holdway, Eva Wilhelm, Michael John Casey, Lolita Horne, Laura C Harris, Andy Clemence, Colleen Delany, Eleanor Todd, Jillian Levine-Sisson, Ken Jackson, Nanna Ingvarsson, Terence Aselford, Todd Scofield, Rose Elizabeth Supan, Mort Shelby.</p>"; 
